import React from "react";
import styles from "../styles/Main.module.css";

const About = () => {
  return (
    <section className={styles.about}>
      <div className={styles.about__content}>
        <h1 className={styles.about__title}>О компании СТО «Роял Сервис»</h1>
        <h2 className={styles.about__under_title}>
          Дата основания СТО «Роял Сервис»: 6 ноября 1996 года - 23 года на
          рынке автосервиса.
        </h2>
      </div>
    </section>
  );
};

export default About;
